import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gradient-to-br from-blue-300 to-purple-400">
      <h1 
        className="text-5xl font-extrabold text-white mb-10 opacity-0 animate-fade-in"
      >
        Welcome to the App
      </h1>

      <button
        onClick={() => navigate('/profile')}
        className="w-64 px-6 py-3 bg-blue-600 text-white rounded-lg shadow-lg mb-4 transition-transform transform hover:scale-105 hover:bg-blue-700"
      >
        Go to Profile
      </button>

      <button
        onClick={() => navigate('/todo')}
        className="w-64 px-6 py-3 bg-green-500 text-white rounded-lg shadow-lg transition-transform transform hover:scale-105 hover:bg-green-600"
      >
        Go to To-Do List
      </button>
    </div>
  );
}

export default Home;
